function createRow(x, y, data, color){
    // doc.rect(x+0, y, 125, 20); 
    // doc.rect(x+125, y, 86, 20); 
    // doc.rect(x+211, y, 125, 20); 
    // doc.rect(x+336, y, 86, 20); 
    // doc.rect(x+422, y, 65, 20); 
    // doc.rect(x+487, y, 71, 20); 
    rowBg(y, color);
    centerText(data.dateIn, 12, x+0, y, 125);
    centerText(data.timeIn, 12, x+125, y, 86);
    centerText(data.dateOut, 12, x+211, y, 125);
    centerText(data.timeOut, 12, x+336, y, 86);
    centerText(data.lateHrs, 12, x+422, y, 65);
    centerText(data.total, 12, x+487, y, 71);
    
}

function rowBg(y, color){
    doc.setDrawColor(0);
    if(color === 'light'){
        doc.setFillColor(252,252,252); //#fcfcfc
    }else{
        doc.setFillColor(242, 242, 242); //#f2f2f2
    }
    doc.rect((WIDTH-558)/2, y, 558, 20, 'F'); 
}

function createHeaders(x, y){
    
    // Create Headers Borders
    // doc.rect(x+0, y, 125, 20); 
    // doc.rect(x+125, y, 86, 20); 
    // doc.rect(x+211, y, 125, 20); 
    // doc.rect(x+336, y, 86, 20); 
    // doc.rect(x+422, y, 65, 20); 
    // doc.rect(x+487, y, 71, 20); 
    rowBg(y, 'dark');
    
    // Create Headers
    centerTextHeader('Date', 12, x+0, y, 125);
    centerTextHeader('Time In', 12, x+125, y, 86);
    centerTextHeader('Date', 12, x+211, y, 125);
    centerTextHeader('Time Out', 12, x+336, y, 86);
    centerTextHeader('Late Hrs', 12, x+422, y, 65);
    centerTextHeader('Total', 12, x+487, y, 71);
}

function setTextHeader(text, x, y, size, alignment){
    doc.setFont('helvetica');
    doc.setFontStyle('bold');
    doc.setFontSize(size);
    doc.text(x, y, text, null, null, alignment);
}

function centerTextHeader(text, size, start_x, start_y, width, height){
    txtWidth = doc.getStringUnitWidth(text) * size / doc.internal.scaleFactor;
    x = ( width - txtWidth ) / 2;
    setTextHeader(text, start_x+x, start_y+13, size, '');
}

function setText(text, x, y, size, alignment){
    doc.setFont('helvetica');
    doc.setFontSize(size);
    doc.text(x, y, text, null, null, alignment);
}

function centerText(text, size, start_x, start_y, width, height){
    txtWidth = doc.getStringUnitWidth(text) * size / doc.internal.scaleFactor;
    x = ( width - txtWidth ) / 2;
    setText(text, start_x+x, start_y+13, size, '');
}


